couldNotRemoveIdentityProvider:"P\u0159i odstra\u0148ov\u00e1n\u00ed nastaven\u00e9ho poskytovatele identit do\u0161lo k chyb\u011b.",aboutIdentityFederation:"Federace identit je umo\u017en\u011bna nav\u00e1z\u00e1n\u00edm d\u016fv\u011bryhodn\u00e9ho vztahu mezi poskytovatelem identit a slu\u017ebou ArcGIS Online, kter\u00e1 funguje jako poskytovatel slu\u017eeb. Oba poskytovatel\u00e9 si vym\u011b\u0148uj\u00ed informace prost\u0159ednictv\u00edm webov\u00e9ho protokolu SAML2.",aboutIdentityFederationPortal:"Federace identit je umo\u017en\u011bna nav\u00e1z\u00e1n\u00edm d\u016fv\u011bryhodn\u00e9ho vztahu mezi poskytovatelem identit a slu\u017ebou Portal for ArcGIS, kter\u00fd funguje jako poskytovatel slu\u017eeb. Oba poskytovatel\u00e9 si vym\u011b\u0148uj\u00ed informace prost\u0159ednictv\u00edm webov\u00e9ho protokolu SAML2.",
onceFederated:"Jakmile federaci nastav\u00edte, budou \u010dlenov\u00e9 automaticky p\u0159esm\u011brov\u00e1ni na podnikov\u00e9 webov\u00e9 servery, kter\u00e9 umo\u017e\u0148uj\u00ed p\u0159ihl\u00e1\u0161en\u00ed k dan\u00e9mu podniku. V\u00fdsledky tohoto p\u0159ihl\u00e1\u0161en\u00ed jsou sd\u011blov\u00e1ny zp\u011bt ArcGIS Online. U\u017eivatel\u00e9 tak maj\u00ed mo\u017enost pracovat se sv\u00fdm obsahem v ArcGIS Online.",onceFederatedPortal:"Jakmile federaci nastav\u00edte, budou \u010dlenov\u00e9 automaticky p\u0159esm\u011brov\u00e1ni na podnikov\u00e9 webov\u00e9 servery, kter\u00e9 umo\u017e\u0148uj\u00ed p\u0159ihl\u00e1\u0161en\u00ed k dan\u00e9mu podniku. V\u00fdsledky tohoto p\u0159ihl\u00e1\u0161en\u00ed jsou sd\u011blov\u00e1ny zp\u011bt do Portal for ArcGIS. U\u017eivatel\u00e9 tak maj\u00ed mo\u017enost pracovat se sv\u00fdm obsahem v Portal for ArcGIS.",
useSetIdentityProvider:"Tla\u010d\u00edtkem Nastavit poskytovatele identit, poskytnete ArcGIS Online informace o sv\u00e9m poskytovateli identit, kter\u00fd vyu\u017e\u00edv\u00e1 protokolu SAML2.",useSetIdentityProviderPortal:"Tla\u010d\u00edtkem Nastavit poskytovatele identit, poskytnete slu\u017eb\u011b Portal for ArcGIS informace o sv\u00e9m poskytovateli identit, kter\u00fd vyu\u017e\u00edv\u00e1 protokolu SAML2.",useGetServiceProvider:"Tla\u010d\u00edtkem Z\u00edskat poskytovatele slu\u017eeb m\u016f\u017eete sv\u00e9mu poskytovateli identit poskytnout informace o ArcGIS Online (kter\u00fd v tomto kontextu p\u0159edstavuje poskytovatele slu\u017eeb).",
useGetServiceProviderPortal:"Tla\u010d\u00edtkem Z\u00edskat poskytovatele slu\u017eeb m\u016f\u017eete sv\u00e9mu poskytovateli identit poskytnout informace o ArcGIS Online (kter\u00fd v tomto kontextu p\u0159edstavuje poskytovatele slu\u017eeb).",signInSetting:"Mo\u017enosti p\u0159ihl\u00e1\u0161en\u00ed",signInDesc:"P\u0159izp\u016fsobte si ${type} p\u0159ihla\u0161ovac\u00ed str\u00e1nky tak, aby ${tooltipStart} se \u010dlenov\u00e9 organizace mohli p\u0159ihla\u0161ovat pomoc\u00ed${tooltipEnd}:",
signInTooltip:"M\u016f\u017eete pou\u017e\u00edt tuto sekci k \u0159\u00edzen\u00ed v\u00fdb\u011bru zobrazen\u00fdch mo\u017enost\u00ed na p\u0159ihla\u0161ovac\u00ed str\u00e1nce. Pokud se v\u011bt\u0161ina va\u0161ich \u010dlen\u016f p\u0159ihla\u0161uje pomoc\u00ed sv\u00e9ho ${name} podnikov\u00e9ho \u00fa\u010dtu, pak m\u016f\u017eete povolit pouze tuto mo\u017enost na va\u0161\u00ed $ {type} vlastn\u00ed p\u0159ihla\u0161ovac\u00ed str\u00e1nce. Spr\u00e1vci, kte\u0159\u00ed se cht\u011bj\u00ed p\u0159ihl\u00e1sit pomoc\u00ed sv\u00e9ho $ {arcgis} \u00fa\u010dtu, mohou tak je\u0161t\u011b u\u010dinit prost\u0159ednictv\u00edm standardn\u00edho ${site} p\u0159ihla\u0161ov\u00e1n\u00ed na str\u00e1nce.",
